     // obtenir la couleur en fonction de la valeur de la densité de population
     function getColor(d) {
          return    d > 80 ? '#006837' :
                    d > 60 ? '#31a354' :
                    d > 40 ? '#78c679' :
                    d > 20 ? '#c2e699' :
                    d >  0 || d==0 ? '#ffffcc' :
                               '#EFEFEF';
     };

     function newColor(d){
           return    d > 0.8 ? '#006837' :
                    d > 0.6 ? '#31a354' :
                    d > 0.4 ? '#78c679' :
                    d > 0.2 ? '#c2e699' :
                    d >  0 || d==0 ? '#ffffcc' :
                               '#EFEFEF';
     };

    function betaColor(d){
           return    d > 20 ? '#006837' :
                    d > 15 ? '#31a354' :
                    d > 10 ? '#78c679' :
                    d > 5 ? '#c2e699' :
                    d >  0 || d==0 ? '#ffffcc' :
                               '#EFEFEF';
     };     
     
     

