     //Effet lors du passage de la souris sur les polygones
     function highlightFeature(e) {

      legend.onAdd = function (map) {

          var div = L.DomUtil.create('div', 'info legend'),
               grades = [0, 20, 40, 60, 80],
               labels = ['Proportion de germanophones </br> par communes en 2011 (en %)'],
               from, to;

          for (var i = 0; i < grades.length; i++) {
               from = grades[i];
               to = grades[i + 1];

               labels.push(
                    '<i style="background:' + getColor(from + 1) + '"></i> ' +
                    from + (to ? '&ndash;' + to : '+'));
          }

          div.innerHTML = labels.join('<br>');
          return div;
     };

     legend.addTo(map);

      info.onAdd = function (map) {
          this._div = L.DomUtil.create('div', 'info');
          this.update();
          return this._div;
     };

     //Indication sur les passages de souris
     info.update = function (properties) {
          this._div.innerHTML = '<h4>Répartition des germanophones</h4>' +  (properties ?
               '<b>' + properties.NAME_3 + '</b><br />' + Math.round((properties.T_GER*100).toFixed(2)*100)/100 + ' %'
               : 'Passez la souris sur une commune');
     };

     info.addTo(map);

          var layer = e.target;
     //   layer._leaflet_id = feature.id;

          layer.setStyle({
               weight: 5,
               color: '#000000',
               dashArray: '',
               fillOpacity: 0
          });


          if (!L.Browser.ie && !L.Browser.opera && !L.Browser.edge) {
               layer.bringToFront();
          }

          info.update(layer.feature.properties);
     }

