     map.attributionControl.addAttribution('Population data &copy; <a href="http://census.gov/">US Census Bureau</a>');

     L.control.layers({
        "Germanophones": geojson,
        "Italophones": ITA,
        "Ladinophones": LAD,
        "Etrangers": ETR,
        "Herfindhal": HN
    }).addTo(map);

